     */
    function deposit(uint256 _depositId, uint256 _amount) public {
        require(
            _depositId > 0 && _depositId <= lastDepositIds[msg.sender],
            "wrong deposit id"
        );
        _deposit(msg.sender, _depositId, _amount);
        require(
            umiToken.transferFrom(msg.sender, address(this), _amount),
